import React, { Component } from "react";
import { Animated } from "react-animated-css";

class Profile extends Component {
  render() {
    return (
      <div class="jumbotron jumbotron-fluid custom-profile">
        <div class="container">
          <h1 class="display-4">I'm Jae Ung Kim</h1>
          <p class="lead"></p>
        </div>
      </div>
    );
  }
}
export default Profile;
